import React, { useEffect } from 'react';
import { client } from '../apolloGqlClient';
import PostCard from '../Components/PostCard';
import { fetch_posts_query } from '../gqlQueries';

const Home = () => {

  useEffect(async () => {
    fetchPosts()

  }, [])

  const fetchPosts = async () => {

    try {
      const resp = await client.query({
        query: fetch_posts_query, fetchPolicy: 'no-cache', variables: {
          input: null
        }
      })
      console.log(resp)
    } catch (error) { console.log(error) }

  }

  return (
    <>
      {
        [1, 2, 3, 4, 5, 6, 7, 7, 99, 6, 4, 2].map((itm, idx) => (
          <>
            <PostCard key={idx} showCommentIdx={() => console.log(idx)} />
          </>
        ))
      }
    </>
  );
}

export default Home;
